import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "../components/Weather";

export default props => (
  <Router>
    <Switch>
      <Route path="/" exact component={Weather} />
    </Switch>
  </Router>
);
